// * grid[i][j] -> 0 | 1
// * 1 <= capacity <= 10
func max_fill(grid [][]int, capacity int) int {
    totalWater := 0
    for _, row := range grid {
        for _, cell := range row {
            totalWater += cell
        }
    }
    if totalWater%capacity == 0 {
        return totalWater / capacity
    }
    return totalWater/capacity + 1
}

