// The basic algebra operations:
// Addition ( + ) 
// Subtraction ( - ) 
// Multiplication ( * ) 
// Floor division ( // ) 
// Exponentiation ( ** ) 
// Example:
// operator['+', '*', '-']
// list = [2, 3, 4, 5]
// result = 2 + 3 * 4 - 5
// => result = 9
// Note:
// The length of operator list is equal to the length of operand list minus one.
// Operand is a list of of non-negative integers.
// Operator list has at least one operator, and operand list has at least two operands.
func do_algebra(operator []string, operand []int) int {
    result := operand[0]
    for i, op := range operator {
        switch op {
        case "+":
            result += operand[i+1]
        case "-":
            result -= operand[i+1]
        case "*":
            result *= operand[i+1]
        case "/":
            result /= operand[i+1]
        case "**":
            temp := result
            for j := 1; j < operand[i+1]; j++ {
                result *= temp
            }
        }
    }
    return result
}

