// >>> factorize(8)
// []int{2, 2, 2}
// >>> factorize(25)
// []int{5, 5}
// >>> factorize(70)
// []int{2, 5, 7}
func factorize(n int) []int {
  factors := make([]int, 0)
  for i := 2; i*i <= n; i++ {
    for n%i == 0 {
      factors = append(factors, i)
      n /= i
    }
  }
  if n > 1 {
    factors = append(factors, n)
  }
  return factors
}

