// >>> make_palindrome("")
// ""
// >>> make_palindrome("cat")
// "catac"
// >>> make_palindrome("cata")
// "catac"
func make_palindrome(myString string) string {
    if len(myString) == 0 {
        return ""
    }

    reverse := func(s string) string {
        runes := []rune(s)
        for i, j := 0, len(runes)-1; i < j; i, j = i+1, j-1 {
            runes[i], runes[j] = runes[j], runes[i]
        }
        return string(runes)
    }

    for i := len(myString); i >= 0; i-- {
        if myString[:i] == reverse(myString[:i]) {
            return myString + reverse(myString[i:])
        }
    }

    return myString + reverse(myString[1:])
}

