    balance := 0
    for _, str := range lst {
        for _, ch := range str {
            if ch == '(' {
                balance++
            } else if ch == ')' {
                balance--
            }
            if balance < 0 {
                return "No"
            }
        }
    }
    if balance == 0 {
        return "Yes"
    }
    return "No"
}

