func monotonic(l []int) bool {
    if len(l) <= 2 {
        return true
    }

    direction := l[1] - l[0]
    for i := 2; i < len(l); i++ {
        if direction > 0 && l[i] - l[i-1] < 0 {
            return false
        } else if direction < 0 && l[i] - l[i-1] > 0 {
            return false
        } else if direction == 0 {
            direction = l[i] - l[i-1]
        }
    }

    return true
}

