// Task
// We are given two strings s and c, you have to deleted all the characters in s that are equal to any character in c
// then check if the result string is palindrome.
// A string is called palindrome if it reads the same backward as forward.
// You should return a list containing the result string and true/false for the check.
// Example
// >>> reverse_delete("abcde", "ae")
// []interface{}{"bcd", false}
// >>> reverse_delete("abcdef", "b")
// []interface{}{"acdef", false}
// >>> reverse_delete("abcdedcba", "ab")
// []interface{}{"cdedc", true}
func reverse_delete(s string, c string) []interface{} {
    chars := make(map[rune]bool)
    for _, ch := range c {
        chars[ch] = true
    }

    var result []rune
    for _, ch := range s {
        if !chars[ch] {
            result = append(result, ch)
        }
    }

    str := string(result)
    isPalindrome := str == reverse(str)

    return []interface{}{str, isPalindrome}
}

func reverse(s string) string {
    runes := []rune(s)
    for i, j := 0, len(runes)-1; i < j; i, j = i+1, j-1 {
        runes[i], runes[j] = runes[j], runes[i]
    }
    return string(runes)
}

