// []int{1, 4, 2, 4, 3}
func intersperse(numbers []int, delimeter int) []int {
  if len(numbers) < 2 {
    return numbers
  }

  result := make([]int, 0, len(numbers)*2-1)
  for i, number := range numbers {
    if i > 0 {
      result = append(result, delimeter)
    }
    result = append(result, number)
  }

  return result
}

